import { Link } from 'react-router-dom'
import { data } from './datas.json'

function Card () {
	return (
		<div className='dataLogement'>
			{ 
			data.map((data,i) => (
				<div className='dataComponents' key={i}>
					<p>{ data.title }</p>
					<p>{ data.id }</p>
					<img>{ data.cover }</img>
		</div>	))}
		</div>
	)
}
export default Card;
